import { Component, NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { DetailsComponent } from 'src/app/layout/details/details.component';

const routes: Routes = [
  {
    path:'', component: DetailsComponent,
    children:[
      {
        path:'chapterdetails/:id', 
        loadChildren:()=>import('../chapterdetails/chapterdetails.module').then(m=>m.ChapterdetailsModule)
      },
      {
        path:'chapterdetails/:id/manage',
        loadChildren:()=>import('../manage/manage-routing.module').then(m=>m.ManageRoutingModule)
      },
    ]
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class DetailsRoutingModule { }
